      icon: <DirectionsCarIcon />,
      path: "/vehicle",
    },

    {
      text: "Flight",
      icon: <FlightIcon />,
      path: "/flight",
    },
    {
      text: "Electricity",
      icon: <OfflineBoltIcon />,
      path: "/electricity",
    },
    {
      text: "Donation",
      icon: <CardGiftcardIcon/>,
